import {makeObservable} from "mobx";

export default class sellerStore {
    constructor() {
        this._isAuth = false
        this._seller = {}
        makeObservable(this)
    }
    setIsAuth(bool) {
        this._isAuth = bool
    }
    setSeller(seller) {
        this._seller = seller
    }
    get isAuth() {
        return this._isAuth
    }
    get seller() {
        return this._seller
    }
}
